    return (
        <div style={{"marginLeft":"1%", "display":"flex", "flexDirection":"row"}}>
            <div style={{"float":"left"}} id='left'>
                <RegisterComponent />
            </div>
            <div style={{"marginLeft":"20%"}} id='right'>
                <LoginComponent />
